import React from "react";
import Tile from "./Tile.jsx";

const Board = () => {
  let board = [1, 2, 3];

  return (
    <div>
      {board.map((value) => (
        <Tile numSquare={value}></Tile>
      ))}
      ;
    </div>
  );
};

export default Board;
